import React from 'react';
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import "./Header.css"

export default function Header(props) {
    const navigate = useNavigate();

    function signin() {
        localStorage.removeItem('jwt');
        navigate("/sign-in");
        window.location.reload()
    }

    return (
        <header className="header">
            <div className="header__logo" />
            <div className="header__container">
                {!props.loggedIn && <button className="header__signin">Войти</button>}
                <Routes>
                    <Route path='/' element={<Link to='/sign-in' onClick={signin} className="register__link header__signin">Войти</Link>} ></Route>
                    <Route path='/sign-up' element={<Link to='/sign-in' className="header__sign-up"></Link>} />
                    <Route path='/sign-in' element={<Link to='/sign-up' className="header__login" />} />
                </Routes>
            </div>
        </header>
    )
}
